import CardHeader from "../../molecules/job-card-header/card-header";
import CardBody from "../../molecules/job-card-body/card-body";

interface Props {
    title: string,
    company: string,
    location: string,
    type: string,
    description: string
}

function Card (props: Props) {
    const { title, company, location, type, description } = props;
  return (
    <div className="card-wrapper">
        <CardHeader title={title} company={company} location={location} type={type}/>
        <CardBody description={description}/>
    </div>
  );
}

export default Card;
